Здравствуйте! Меня зовут Галина Галкина. 
Я свадебный стилист и владелец  выездной Бьюти студии "GALAктика".
Работаю в свадебной индустрии красоты и волшебных перевоплощений с 2009 года. 
Победитель премии wedding pro awards 2019 в номинации "лучший образ молодых"
Работаю с журналами, артистами, радиостанциями, на конкурсах красоты и на различных фото проектах. 
 Вкладывать душу в образы девочек, делать эксклюзивные, неповторимые прически - вот мой девиз. Я необыкновенно творческая натура, которая влюблена в безупречность во всем, что делаю. Врожденное чувство меры, европейский подход к созданию образа, виртуозное исполнение вечерних укладок на длинные волосы и самое главное - безумно люблю свою работу. 
Мы предлагаем:
- неповторимые свадебные прически для невесты;
- вечерние прически и укладки для родственников и подруг невесты;
- свадебный и вечерний макияж;
- экспресс-макияж для родственников и подруг невесты;
- репетиция свадебного образа (создание полноценной пробной свадебной прически и макияжа, возможно несколько вариантов);
- консультация по подбору формы прически, используемых украшений и цветовой гаммы в макияже;
- создание образа для фотосессии;
- провожу индивидуальное обучение по плетению кос для всех желающих.
• Основной город работы: Ростов-на-Дону
• Дополнительные города работы: Азов, Батайск, Аксай, Новочеркасск, Таганрог, Москва, Санкт-Петербург.
